import React from "react";
const Nav = () => {
  return (
    <nav>
      <div>Logo</div>
      <div>
        <Link>Home</Link>
        <Link>Registrations</Link>
        <Link>Admin-</Link>
        <Link>Logout</Link>
      </div>
    </nav>
  );
};
export default Nav;
